import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Use a locator to find the first "Your Profile" link and click it
    const profileLink = page.locator('a:has-text("Your Profile")').first();
    await profileLink.waitFor({ state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_click.png'));

    await profileLink.click();

    // Wait for the profile page content to appear
    await page.waitForSelector('.profile-page', { timeout: 5000 });

    // Verify by checking for the profile name "Jun Kim"
    const profileHeader = page.locator('h2:has-text("Jun Kim")');
    await profileHeader.waitFor({ state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_page.png'));

    // Extract data to confirm the action
    const profileName = await profileHeader.textContent();
    const username = await page.locator('.username').textContent();

    return {
      success: true,
      action: "Navigated to Jun's Profile page",
      extractedData: {
        profileName: profileName.trim(),
        username: username.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
